                  file.type = "results",
                  barcode = fin_list[i], 
                  legacy = TRUE)

# Download a list of barcodes
GDCdownload(query)

# Prepare expression matrix with geneID in the rows and samples (barcode) in the columns
dataFilt <- GDCprepare(query)

# selection of normal samples "NT"
samplesNT <- TCGAquery_SampleTypes(barcode = colnames(dataFilt),
                                   typesample = c("NT"))

# selection of tumor samples "TP"
samplesTP <- TCGAquery_SampleTypes(barcode = colnames(dataFilt), 
                                   typesample = c("TP"))

# Diff.expr.analysis (DEA)
dataDEGs <- TCGAanalyze_DEA(mat1 = dataFilt[,samplesNT],
                            mat2 = dataFilt[,samplesTP],
                            Cond1type = "Normal",
                            Cond2type = "Tumor")

# DEGs table with expression values in normal and tumor samples
dataDEGsFiltLevel <- TCGAanalyze_LevelTab(dataDEGs,"Tumor","Normal",
                                          dataFilt[,samplesTP],dataFilt[,samplesNT])

dataDEGsFiltLevel_result <- dataDEGsFiltLevel[,mRNA:logFC]
write.table(dataDEGsFiltLevel_result, "cancer_types/"+cancer_typelist[i]+"/exp_diff/DiffGeneExpression.txt", sep="\t")
}